playSound("On-My-Way-Lofi-Study-Music.mp3", true);
setProperty("pleaseentername", "hidden", true);
setProperty("userchoicetext", "hidden", true);
setProperty("compchoicetext", "hidden", true);
var nameUser;
var userWins = [];
var compWins = [];
var ties = [];
var rock;
var paper;
var scissors;
var choices = [rock, paper, scissors];
var compChoice;
var userChoice;
var rounds = [];
onEvent("namenextbutton", "click", function( ) {
  if (getText("nameInput") == "") {
    setProperty("pleaseentername", "hidden", false);
  } else {
    nameUser = getText("nameInput");
    setScreen("doyouknow");
    setText("text_area3", "Hi " + nameUser + "! Do you know how to play rock paper scissors?");
  }
});
onEvent("doyouknowYes", "click", function( ) {
  setScreen("doyouknoyestransition");
});
onEvent("areyoureadyyestrans", "click", function( ) {
  setScreen("gamescreen");
});
onEvent("rockimg", "click", function( ) {
  setText("userchoicetext", "rock");
  userChoice = rock;
  setImageURL("userPick", "data:image/png;base64,");
  computerChoice();
  whoWon();
});
onEvent("paperimg", "click", function( ) {
  setText("userchoicetext", "paper");
  userChoice = paper;
  setImageURL("userPick", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTl_cKa8kvOWMFte8MgiL1zAY8Gv_sHoQ3yVg&usqp=CAU");
  computerChoice();
  whoWon();
});
onEvent("scissorsimg", "click", function( ) {
  setText("userchoicetext", "scissors");
  userChoice = scissors;
  setImageURL("userPick", "data:image/png;base64,");
  computerChoice();
  whoWon();
});
function computerChoice() {
  var randomIndex = randomNumber(0, choices.length - 1);
  if (randomIndex == 0) {
    setImageURL("computerPick", "data:image/png;base64,");
    compChoice = rock;
    setText("compchoicetext", "rock");
  } else if (randomIndex == 1) {
    setImageURL("computerPick", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTl_cKa8kvOWMFte8MgiL1zAY8Gv_sHoQ3yVg&usqp=CAU");
    compChoice = paper;
    setText("compchoicetext", "paper");
  } else {
    setImageURL("computerPick", "data:image/png;base64,");
    compChoice = scissors;
    setText("compchoicetext", "scissors");
  }
}
function whoWon() {
  if (getText("compchoicetext")==getText("userchoicetext")) {
    setText("whowondisplay", "It's a tie!");
    appendItem(rounds, 0);
  }
  if (getText("userchoicetext") == "scissors" && getText("compchoicetext") == "paper") {
    setText("whowondisplay", "You win this round!");
  } else if ((getText("userchoicetext") == "scissors" && getText("compchoicetext") == "rock")) {
    setText("whowondisplay", "The computer wins this round!");
  }
  if (getText("userchoicetext") == "rock" && getText("compchoicetext") == "scissors") {
    setText("whowondisplay", "You win this round!");
  } else if ((getText("userchoicetext") == "rock" && getText("compchoicetext") == "paper")) {
    setText("whowondisplay", "The computer wins this round!");
  }
  if (getText("userchoicetext") == "paper" && getText("compchoicetext") == "scissors") {
    setText("whowondisplay", "The computer wins this round!");
  } else if ((getText("userchoicetext") == "paper" && getText("compchoicetext") == "rock")) {
    setText("whowondisplay", "You win this round!");
  }
  if (rounds.length == 10) {
    setScreen("results");
  }
}
